import React from 'react'
import ToDo from './ToDo'

const ToDoList = (toDoes) => {
  return (
    <ul>
        {toDoes.map((Todo) => {
             <ToDo
             key={Todo.todo_id}
             Todo={Todo}/>
        })
        }
    </ul>
  )
}

export default ToDoList
